// src/components/Services.jsx
import React from 'react';
import ServiceCard from './ServiceCard';

export default function Services({ cards }) {
  return (
    <div className="d-flex flex-row flex-wrap">
      {cards.map((c, i) => (
        <ServicesCard
          key={i}
          title={c.title}
          text={c.text}
          accent={c.accent}
        />
      ))}
    </div>
  );
}
